import { Outlet, Link } from "react-router-dom";
import { Fragment } from "react";

const Navigation = () => {
  return (
    <Fragment>
      <div className='navigation'>
        <div>Logo</div>
        <div className='nav-links-contener'>
          \<Link className='nav-link' to='/shope'></Link>
        </div>
        <Outlet />
      </div>
    </Fragment>
  );
};

export default Navigation;
